export const handleTouchStart = (index) => {
    console.log(`handleTouchStart ${index}`)
    setTimer(setTimeout(() => {
        setState({
            editIndex: index,
            showButtons: true
        })
    }, 1000));
};

export const handleTouchEnd = () => {
    clearTimeout(timer);
};
